import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category using multiple selector strategies
    const electronicsSelectors = [
      'a:has-text("Electronics")',
      'div.category-card:has-text("Electronics")',
      '//a[contains(text(), "Electronics")]'
    ];

    let electronicsClicked = false;
    for (const selector of electronicsSelectors) {
      try {
        await page.waitForSelector(selector, { timeout: 5000 });
        await page.click(selector);
        electronicsClicked = true;
        break;
      } catch (error) {
        continue;
      }
    }

    if (!electronicsClicked) {
      throw new Error('Could not find Electronics category element');
    }

    // Wait for navigation to complete and take screenshot
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Verify we're on Electronics category by checking page content
    const categoryTitle = await page.textContent('h2').catch(() => null);
    const pageContent = await page.textContent('body');

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        categoryTitle: categoryTitle,
        hasElectronicsContent: pageContent.includes('Electronics') || pageContent.includes('electronics')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
